import React from "react";

export default function App(){
  return (
    <div style={{padding:20}}>
      <h1>AI Project Evaluator</h1>
      <form action="http://localhost:5000/evaluate" method="post" encType="multipart/form-data">
        <input name="name" placeholder="Student Name" /><br/><br/>
        <input name="college" placeholder="College Name" /><br/><br/>
        <input name="dept" placeholder="Department" /><br/><br/>
        <input name="year" placeholder="Year" /><br/><br/>
        <input type="file" name="problem" /><br/><br/>
        <input type="file" name="code" /><br/><br/>
        <button>Evaluate Project</button>
      </form>
    </div>
  );
}
